import React, {useEffect,useRef} from 'react';
import "./intro.scss";
import {init} from 'ityped';

export default function Intro() {
   
  const textRef=useRef();

  useEffect(() =>{
    init(textRef.current, { showCursor: false,  strings: ['BALUSTRADE', 'GRILAJE' , 'PORTI' ] });
  },[])
  return (
    <div className="intro" id="intro">
      <div className="left">
           <div className="itemContainer">
               <img src="assets/man.png" alt=""/>
           </div>
      </div>

      <div className="right">
        <div className="wrapper">
          <h2>GARDURI METALICE</h2>
          <h1>BALUSTRADE</h1>
          <h3>SCARI METALICE <span useRef={textRef}></span></h3>
        </div>

        <a href="#portofolio" >
          <img src="assets/down.png" alt=""/>
        </a>
      </div>
    </div>
  )
}
